import "./MostPopular.css";
import { MostPopularCard, Title ,SectionWrapper} from "../../components/index";

// import  MostPopularData from "./Data/MostPopularData"
function MostPopular() {
  const MostPopularData= [{
    image:image1,
    name:"Fortnight",
    type:"sandbox",
    rate:"3",
    download:"3.M",},
 {
    image:image2,
    name:"PubG",
    type:"Battle S",
    rate:"3",
    download:"3.M",}
  ,
    {image:image3,
    name:"Dota2",
    type:"Steam-X",
    'rate':"3",
    download:"3.M",}
    ,{
    image:image4,
    name:"CS-GO",
    type:"Legendary",
    rate:"3",
    download:"3.M",}
    ,{
    image:image5,
    name:"Craft",
    type:"Legendary",
    rate:"3",
    download:"3.M",}
  ,{
    image:image6,
    name:"Warcraft",
    type:"Legendary",
    rate:"3",
    download:"3.M",}
  ,{
    image:image7,
    name:"Warface",
    type:"Max 3D",
    rate:"3",
    download:"3.M",}
    ,{
    image:image8,
    name:"Eagles Fly",
    type:"Matrix Games",
    rate:"3",
    download:"3.M",
 }]
  const MostPopularItems=MostPopularData.map((card)=>
    <MostPopularCard
          image={card.image}
          name={card.name}
          type={card.type}
          rate={card.rate}
          download={card.download}
        />)
  return (
    <SectionWrapper>
      <Title titlePrimary="Most Popular" titleSecondary="Right Now" />
      <div className="most-popular-items">
     { MostPopularItems}
      </div>
      </SectionWrapper>
  );
}

export default MostPopular;
